import { Carousel, Image, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";
import img1 from "assets/images/fondo2.jpg"
import img2 from "assets/images/bg-about-us.jpg"


function Carrusel() {
  return (
    <Container>
    <Carousel>
      <Carousel.Item>
        <Image
          src={img1}
          alt="Comienzos de integración a invernadero"
          fluid
        />
        <Carousel.Caption>
          <h3>Comienzos de integración a invernadero</h3>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <Image
          src={img2}
          alt="Forma ejemplificada del invernadero"
          fluid
        />
        <Carousel.Caption>
          <h3>Forma ejemplificada del invernadero</h3>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  </Container>
  );
};

export default Carrusel;
